import React, { Component } from 'react';
import './App.css';

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      test: "Test"
    }
  }

  render() {
    return (
      <div>
        <p>Hello World {this.state.test}</p>
      </div>
    );
  }
}

export default App;
